import "./topbar.css";

export default function Topbar() {
  return <div className="topbarContainer"></div>;
  <div className="topbarLeft">
    <span className="log">AlanyaSocial</span>
  </div>;
  <div className="topbarCenter"></div>;
  <div className="topbarRight"></div>;
}
